When compiled with feature io_parquet, this crate can be used to read parquet files to arrow. It makes minimal assumptions on how you to decompose CPU and IO intensive tasks. First, some notation: page: part of a column (e.g. similar of a slice of an Array) column chunk: composed of multiple pages (similar of an Array) row group: a group of columns with the same length (similar of a RecordBatch in Arrow) Here is how to read a single column chunk from a single row group: use std::fs::File; use arrow2::compute::cast::cast;
use arrow2::io::parquet::read;
use arrow2::{array::Array, error::Result}; fn read_column_chunk(path: &str, row_group: usize, column: usize) -> Result<Box<dyn Array>> { // Open a file, a common operation in Rust let mut file = File::open(path)?; // Read the files' metadata. This has a small IO cost because it requires seeking to the end // of the file to read its footer. let file_metadata = read::read_metadata(&mut file)?; // Convert the files' metadata into an arrow schema. This is CPU-only and amounts to // parse thrift if the arrow format is available on a key, or infering the arrow schema from // the parquet's physical, converted and logical types. let arrow_schema = read::get_schema(&file_metadata)?; // Construct an iterator over pages. This binds `file` to this iterator, and each iteration // is IO intensive as it will read a compressed page into memory. There is almost no CPU work // on this operation let iter = read::get_page_iterator(&file_metadata, row_group, column, &mut file)?; // This is for now required, but we hope to remove the need for this clone. let descriptor = iter.descriptor().clone(); // This is the actual work. In this case, pages are read (by calling `iter.next()`) and are // immediately decompressed, decoded, deserialized to arrow and deallocated. // This uses a combination of IO and CPU. At this point, `array` is the arrow-corresponding // array of the parquets' physical type. let array = read::page_iter_to_array(iter, &descriptor)?; // Cast the array to the corresponding Arrow's data type. When the physical type // is the same, this operation is `O(1)`. Otherwise, it incurs some CPU cost. cast(array.as_ref(), arrow_schema.field(column).data_type())
} fn main() -> Result<()> { use std::env; let args: Vec<String> = env::args().collect(); let file_path = &args[1]; let column = args[2].parse::<usize>().unwrap(); let row_group = args[3].parse::<usize>().unwrap(); let array = read_column_chunk(&file_path, row_group, column)?; println!("{}", array); Ok(())
} The example above minimizes memory usage at the expense of mixing IO and CPU tasks on the same thread, which may hurt performance if one of them is a bottleneck.

