use std::iter::once; use arrow2::{ array::{Array, Int32Array}, datatypes::{Field, Schema}, error::Result, io::parquet::write::{array_to_page, to_parquet_type, write_file, CompressionCodec},
}; fn write_single_array(path: &str, array: &dyn Array, field: Field) -> Result<()> { let schema = Schema::new(vec![field]); // declare the compression let compression = CompressionCodec::Uncompressed; // map arrow fields to parquet fields let parquet_types = schema .fields() .iter() .map(to_parquet_type) .collect::<Result<Vec<_>>>()?; // Declare the row group iterator. This must be an iterator of iterators of iterators: // * first iterator of row groups // * second iterator of column chunks // * third iterator of pages // an array can be divided in multiple pages via `.slice(offset, length)` (`O(1)`). // All column chunks within a row group MUST have the same length. let row_groups = once(Result::Ok(once(Ok(once(array) .zip(parquet_types.iter()) .map(|(array, type_)| array_to_page(array, type_, compression)))))); // Create a new empty file let mut file = File::create(path)?; // Write the file. Note that, at present, any error results in a corrupted file. Ok(write_file( &mut file, row_groups, &schema, CompressionCodec::Uncompressed, None, )?)
} fn main() -> Result<()> { let array = Int32Array::from(&[ Some(0), Some(1), Some(2), Some(3), Some(4), Some(5), Some(6), ]); let field = Field::new("c1", array.data_type().clone(), true); write_single_array("test.parquet", &array, field)
}

