The simplest way to think about an arrow Array is that it represents Vec<Option<T>> and has a logical type associated with it. Probably the most simple array in this crate is PrimitiveArray<T>. It can be constructed from an iterator as follows: # use arrow2::array::{Array, PrimitiveArray, Primitive};
# use arrow2::datatypes::DataType;
# fn main() {
let array: PrimitiveArray<i32> = [Some(1), None, Some(123)] .iter() .collect::<Primitive<i32>>() .to(DataType::Int32);
assert_eq!(array.len(), 3)
# } A PrimitiveArray has 3 components: A physical type (i32) A logical type (e.g. DataType::Int32) Data The main differences from a Vec<Option<T>> are: Its data is laid out in memory as a Buffer<T> and an Option<Bitmap>. It has an associated logical datatype. The first difference allows interoperability with Arrow's ecosystem and efficient SIMD operations (we will re-visit this below); the second difference is that it gives semantic meaning to the array. In the example # use arrow2::array::Primitive;
# use arrow2::datatypes::DataType;
# fn main() {
let ints = Primitive::<i32>::from(&[Some(1), None]).to(DataType::Int32);
let dates = Primitive::<i32>::from(&[Some(1), None]).to(DataType::Date32);
# } ints and dates have the same in-memory representation but different logic representations (e.g. dates are usually represented as a string). Some physical types (e.g. i32) have a "natural" logical DataType (e.g. DataType::Int32). These types support a more compact notation: # use arrow2::array::{Array, PrimitiveArray, Primitive};
# use arrow2::datatypes::DataType;
# fn main() {
let array: PrimitiveArray<i32> = [Some(1), None, Some(123)].iter().collect();
assert_eq!(array.len(), 3)
# } The following arrays are supported: NullArray (just holds nulls) BooleanArray (booleans) PrimitiveArray<T> (for ints, floats) Utf8Array<i32> and Utf8Array<i64> (for strings) BinaryArray<i32> and BinaryArray<i64> (for opaque binaries) FixedSizeBinaryArray (like BinaryArray, but fixed size) ListArray<i32> and ListArray<i64> (nested arrays) FixedSizeListArray (nested arrays of fixed size) StructArray (when each row has different logical types) DictionaryArray<K> (nested array with encoded values)

