We've already seen how to create an array from an iterator. Most arrays also implement IntoIterator: # use arrow2::array::{Array, PrimitiveArray, Primitive};
# use arrow2::datatypes::DataType;
# fn main() {
let array: PrimitiveArray<i32> = [Some(1), None, Some(123)] .iter() .collect::<Primitive<i32>>() .to(DataType::Int32); for item in array.iter() { if let Some(value) = item { println!("{}", value); } else { println!("NULL"); }
}
# } Like FromIterator, this crate contains two sets of APIs to iterate over data. Given an array array: &PrimitiveArray<T>, the following applies: If you need to iterate over Option<T>, use array.iter() If you can operate over the values and validity independently, use array.values() -> &[T] and array.validity() -> &Option<Bitmap> Note that case 1 is useful when e.g. you want to perform an operation that depends on both validity and values, while the latter is suitable for SIMD and copies, as they return contiguous memory regions (slices and bitmaps). We will see below how to leverage these APIs. This idea holds more generally in this crate: values() always returns something that has a contiguous in-memory representation, while iter() returns items taking validity into account. To get an iterator over contiguous values, use array.values().iter(). There is one last API that is worth mentioning, and that is Bitmap::chunks. When performing bitwise operations, it is often more performant to operate on chunks of bits instead of single bits. chunks offers a TrustedLen of u64 with the bits + an extra u64 remainder. We expose two functions, unary(Bitmap, Fn) -> Bitmap and binary(Bitmap, Bitmap, Fn) -> Bitmap that use this API to efficiently perform bitmap operations.

