One of the main advantages of the arrow format and its memory layout is that it often enables SIMD. For example, an unary operation op on a PrimitiveArray is likely auto-vectorized on the following code: # use arrow2::buffer::Buffer;
# use arrow2::{
# array::{Array, PrimitiveArray},
# types::NativeType,
# datatypes::DataType,
# }; pub fn unary<I, F, O>(array: &PrimitiveArray<I>, op: F, data_type: &DataType) -> PrimitiveArray<O>
where I: NativeType, O: NativeType, F: Fn(I) -> O,
{ let values = array.values().iter().map(|v| op(*v)); // Soundness // `values` is an iterator with a known size because arrays are sized. let values = unsafe { Buffer::from_trusted_len_iter(values) }; PrimitiveArray::<O>::from_data(data_type.clone(), values, array.validity().clone())
} Some notes: We used array.values(), as described above: this operation leverages a contiguous memory region. We leveraged normal rust iterators for the operation. We have used from_trusted_len_iter, which assumes that the iterator is TrustedLen . This (instead of .collect) is necessary because trait specialization is currently unstable. We used op on the array's values irrespectively of their validity, and cloned its validity. This approach is suitable for operations whose branching off is more expensive than operating over all values. If the operation is expensive, then using Primitive::<O>::from_trusted_len_iter is likely faster.
